INSERT INTO `shared_comments` VALUES (1,1,2000,3,0,1,'Hey Alissa, hello to you!','2012-07-31 12:57:24',NULL),(2,1,2002,2001,0,1,'I think Mary beat you by a couple of hours : )','2012-07-31 21:58:54',NULL),(3,1,2003,3,10,3,'That\'s a great idea, I think everyone \"From Startups\" should introduce what startups they were involved in, and at what stage did they exit (i.e.: post seed, series A, post validation...)','2012-08-25 09:13:06',NULL),(4,2,2002,3,0,2,'Cool -- added \"Other\" to previous careers -- if you click on \"My profile\" and again next the question you wish to update you should be able to answer it again. Will look into the skip bug.','2012-08-26 20:49:41',1),(5,3,2002,3,0,2,'Cool -- added \"Other\" to previous careers -- if you click on \"My profile\" and on \"again\" next the question you wish to update you should be able to select \"Other\". Will look into the skip bug -- might a browser bug since this is only compatible with latest version of Chrome/Firefox/Safari.','2012-08-26 20:51:08',NULL),(8,1,2003,3,14,1,'Hi Claire, would you like to write a bit about your startup experiences in the \"From Startups\" smart group? I\'m doing a test','2012-09-02 14:56:42',NULL);
